
debug: true

listen:
  - port: 53
    type: udp
    minTTL: 172800
    maxTTL: 259200
    cache: 5000
    rules:
      - default-group

  - port: 53
    type: tcp
    rules:
     - default-group

forward:
  - 9.9.9.10
  - 149.112.112.10

servers:
  - name: 114DNS
    address: 114.114.114.114
    port: 53
    type: udp

  - name: aliDNS
    address: 223.5.5.5
    port: 53
    type: tcp

  - name: tencent
    address: dot.pub
    port: 443
    type: tls

  - name: google1
    address: 8.8.8.8
    port: 53
    type: tcp

  - name: google2
    address: 8.8.4.4
    port: 53
    type: tcp

  - name: isp1
    address: 59.51.78.211
    port: 53
    type: udp

  - name: isp2
    address: 222.246.129.81
    port: 53
    type: udp

  - name: clash
    address: 172.16.100.2
    port: 53
    type: udp

server-group:
  - name: forward
    type: parallel
    servers:
      - clash

  - name: isp
    type: parallel
    servers:
      - isp1
      - isp2

  - name: public-dns
    type: balancing
    servers:
      - 114DNS
      - aliDNS

  - name: Balancing
    type: balancing
    servers:
      - 114DNS
      - aliDNS

  - name: Parallel
    type: parallel
    servers:
      - 114DNS
      - aliDNS

  - name: FastTest
    type: fasttest
    servers:
      - 114DNS
      - aliDNS

rules-group:
  - name: default-group
    rules:
      - default
      - china

